@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("onelook.com") {


/* === general color change === */

/* remove border colors */
* {border-color: transparent !important;}

/* basic bodies */
html {background: #EBEBE2 url("data:image/png;base64,") !important;}

body {
background: transparent !important; 
color: #222 !important;
margin-bottom: 1em !important;}

font[color] {color: inherit !important;}

/* links */

a:link  {color: #7A7A5F !important; }
a:hover:not(:link) {color: inherit !important; text-decoration: none !important;}
a:link:hover {color: #0200aa !important;}


/* ===== Specific Objects ===== */


/* General BG color for elements with [bgcolor] */
body [bgcolor] {
background-color: #ECECE3 !important; 
border: 2px solid #D7D7CF !important}

/* table holding results */

TABLE[width="100%"][cellpadding="5"] {

background-color: #F6F5F2 !important; 
width: 95% !important;
margin: 0 auto !important;
padding: .5em !important;}

/* Various Specific Tables */
TABLE[width="640"][cellspacing="0"][border="0"][bgcolor="#999999"][align="center"],
TABLE[width="80%"][cellspacing="1"][cellpadding="5"][bordercolor="#000000"][border="1"][bgcolor="#FFFFFF"][bordercolorlight="#CCCCFF"][bordercolordark="#FFFFFF"],
TABLE[width="640"][cellspacing="0"][border="0"][bgcolor="#339966"][align="center"],
TD[align="right"] > TABLE[cellpadding="5"][bgcolor="#FFFFCC"],
TABLE[cellspacing="1"][cellpadding="10"][bordercolor="#000000"][border="1"][bgcolor="#FFFFFF"][bordercolorlight="#C0C0C0"][bordercolordark="#FFFFFF"],
TABLE[cellspacing="1"][cellpadding="10"][bordercolor="#000000"][border="1"][bgcolor="#F0F0F0"][bordercolorlight="#C0C0C0"][bordercolordark="#FFFFFF"],
TABLE[cellspacing="1"][cellpadding="10"][bordercolor="#000000"][border="1"][bgcolor="#FAFAFA"][bordercolorlight="#C0C0C0"][bordercolordark="#FFFFFF"]

{background: #F6F5F2 !important;}

/* Did this word satisfy... */
CENTER > TABLE[cellpadding="5"][bgcolor="#FFFFCC"] {background: #FAFAFA !important; border-color: #DDD !important}

/* remove styling of [bgcolor] within [bgcolor] */
body [bgcolor] [bgcolor] {background: transparent !important; border: none !important;}

/* === Specific color change === */

/* Header, Footer */
html > body > TABLE[width="100%"][cellspacing="0"][border="0"][bgcolor] {
background: none #C9C6BE !important;}

html > body > TABLE[width="100%"][cellspacing="0"][border="0"][bgcolor] a {color: #444 !important;}
html > body > TABLE[width="100%"][cellspacing="0"][border="0"][bgcolor] a:hover {
color: #FFF !important;}

/* Jump to dictionary headings, query emphasis, grammar type */
a + u > b,
#orth,
#easel_hw,
div.hom > div.gramGrp > div.gram[type="pos"],
[id^="easel_pos"] {color: #0d0d0d !important;}

/* Word usage examples*/
[id^="easel_exs"] {color: #577F46 !important}

/* autocomplete */
.autocomplete:empty {display: none !important;}

HTML > BODY > CENTER:nth-child(3) + CENTER {position: relative !important;} /* seems harmless */
.informal {color: #070707 !important;}

/* === Formatting change === */

/* body {

width:95% !important;
font-size: 1em !important;
max-width: 1200px !important;
margin-left: auto !important;
margin-right: auto !important;}  */

/* Jump to: ... (center text) */
TD[align="left"][valign="top"] + td + td P[align="right"] {text-align: center !important;}

/* === image replacement === */

/* Macmillan Speaker Icon */
#mm_audio_logo {

opacity: .9;
width: 0 !important;
height: 0 !important;
padding-left: 39px !important;
padding-top: 39px !important;
background: transparent url("data:image/png;base64,") !important}

#mm_audio_logo:hover {opacity: 1 !important;}


#mm_logo {
width: 0 !important;
height: 0 !important;
padding-left: 165px !important;
padding-top: 40px !important;
background: transparent url("data:image/png;base64,") !important;}



/* Hide */

IMG[src="/img/news1.jpg"],
A[href*="http://a.tribalfusion.com/"],
iframe, embed,
#___plusone_0,
TD[align="left"][valign="top"] > TABLE[width][cellpadding="0"][border="0"][bgcolor="#ffffff"] ~ table:last-of-type {display: none !important;}

}
